import React from 'react';
import Iframe from "react-iframe";

export default function Guitar() {
    return (
      <div>
          <Iframe url="http://www.youtube.com/embed/xDMP3i36naA"
                  id="Guitar_vid"
                  display="initial"
                  width="300px"
                  height="300px"
                  />
      </div>
    );
}
